import logo from './logo.svg';
import './App.css';
import Row from './row';
import requests from './Requests';

function App() {
  return (
    <div className="App">

      <h1>Hello World, we are building Netflix clone</h1>

      <Row title="Trending Now" fetchUrl={requests.fetchTrending} />

    </div>
  );
}

export default App;
